import React from 'react'

const Data = (props) => {
  // console.log(totalRotate)
  return (
    <div className='data'>
      <p className='bonusTimes'>大当たり回数
        <span>{props.bonusTimes}</span>
      </p>
      <p className='rotate'>回転数：{props.rotate}</p>
      <p className='totalRotate'>総回転数：{props.totalRotate}</p>
    </div>
  )
}

export default Data
